
<!DOCTYPE html>

<html dir="rtl" lang="ar">
<head>
<meta charset="utf-8"/>
<meta content="width=device-width, initial-scale=1.0" name="viewport"/>
<title>Dandelion Beauty Care</title>
<style>
    :root{
      --top:#4a4a4a;
      --mid1:#9a7b5a;
      --mid2:#c9ad85;
      --mid3:#a8855f;
      --low:#484039;
      --bottom:#232323;
      --text:#fff;
      --muted:rgba(255,255,255,.8);
      --card-bg:rgba(255,255,255,0.06);
      --card-border:rgba(255,255,255,0.12);
      --gold:#d4af37;
    }

    * {box-sizing: border-box;}
    body {
      margin:0;
      font-family: system-ui, "Segoe UI", Arial, sans-serif;
      color:var(--text);
      background:linear-gradient(180deg,
        var(--top) 0%,
        var(--mid1) 32%,
        var(--mid2) 55%,
        var(--mid3) 70%,
        var(--low) 86%,
        var(--bottom) 100%);
      background-attachment:fixed;
    }

    header {
      max-width:1200px;
      margin:0 auto;
      padding:20px;
    }

    header img {
  width: 100%;
  height: 200px;
  object-fit: cover;
  border: none;
  border-radius: 0;
  background: transparent;
  box-shadow: none;
  filter: contrast(110%) brightness(105%);
  margin-top: 5px;
}

    .hero { display: none; }

    .hero .content {
      max-width:700px;
      background:var(--card-bg);
      border:1px solid var(--card-border);
      border-radius:12px;
      padding:0px 0px;
      backdrop-filter:blur(4px);
    }

    .hero h1 {
      margin:0 0 15px;
      font-size:2.2rem;
    }

    .hero p {
      font-size:1.1rem;
      color:var(--muted);
      margin:0;
    }

    /* روابط الايقونات (ذهبية مثل الأصل) + عرض الأيقونة بجانب الكتابة */
     .social-links {
      
      display:flex;
      flex-direction:column;
      gap:15px;
      margin:40px auto 20px;
      max-width:300px;
    }

    
.social-links a {
  display: flex;
      flex-direction: row-reverse;
  align-items: center;
  justify-content: center;
  gap: 10px;
  text-decoration: none;
  text-align: center;
  padding: 15px;
  border-radius: 8px;
  font-size: 1.1rem;
  font-weight: bold;
  color: var(--gold);       /* النص باللون الذهبي */
  background: #000;         /* الخلفية/الأيقونة باللون الأسود */
  transition: all 0.3s ease;
  box-shadow: 0 4px 12px rgba(0,0,0,.25);
}


    .social-links a:hover {
      transform:translateY(-3px);
      box-shadow:0 6px 16px rgba(0,0,0,.35);
    }

    .social-links .link-icon {
      width:26px;
      height:26px;
      object-fit:contain;
    }

    footer {
      text-align:center;
      padding:20px;
      font-size:.9rem;
      color:var(--muted);
    }

    @media (max-width:600px){
      .hero { display: none; }
      .hero h1 {font-size:1.6rem;}
      .hero p {font-size:1rem;}
    }
  
    /* raise icons */
    .social-links { margin-top: 0px !important; }
    

.social-links a {
  display: flex;
      flex-direction: row-reverse;
  align-items: center;
  justify-content: flex-start;  
  text-decoration: none;
  padding: 12px 30px;  /* padding from left */
  border-radius: 8px;
  font-size: 1.2rem;
  font-weight: bold;
  color: var(--gold);
  background: #000;
  transition: all 0.3s ease;
}

.social-links a span {
   font-family: 'Montserrat Decorative', serif !important; /* فرض استخدام الخط */
   background: linear-gradient(45deg, #eed382);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
   font-weight: bold;
   margin-left: 20px;    /* space between icon and text */
   text-align: left;
   flex: 1;
}

.social-links .link-icon {
  width: 55px;   /* resized icons */
  height: 55px;
  object-fit: contain;
  flex-shrink: 0;

}
</style>
